                                'presencas' => null,
                                'tipoReuniao' => 'Ordinária',
                            ],
                            'Reuniao' => [
                                'legDes' => 'V',
                                'reuActa' => null,
                                'reuDataHora' => '1987-08-25 15:25',
                                'reuId' => 20230,
